import {Component, OnInit} from '@angular/core';
import {ExtracDataUtils} from '../../utils/extracData.utils';
import {RegisterService} from './register.service';
import {UserModel} from '../../models/user.model';
declare var jsPDF: any;
@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent implements OnInit {
  flag = true;
  inscripcion: UserModel = {
    dni: '',
    nombre: '',
    apellidos: '',
    correo: '',
    talleres: null
  };

  public dates;
  public recibidos;

  constructor(public _registerService: RegisterService) {
  }

  public user: UserModel;
  public total = 0;
  public talleres = [];

  ngOnInit() {
    this.dates = [];
    this.obtenerTalleres();

  }

  mensaje() {
    this.flag = false;
  }

  report(dni: string) {
    console.log('el dni es', dni);
    var doc=new jsPDF();
    var imgData = 'data:image/png;base64,';
    var img2Data= 'data:image/png;base64,';
    this._registerService.obtenerdni(dni)
      .subscribe({
        next: (data:any) => {
          this.recibidos = data.res[0];
          console.log('Datos de consulta recibidos:', data.res);
          doc.addImage(imgData,'JPEG',10, 5, 38, 20);
          doc.addImage(img2Data,'JPEG',50, 10, 35, 12);
          doc.line(10,25,200,25);
          doc.setLineWidth(1);
          doc.line(10,26,200,26);
          //primera frase

          doc.setFont('helvetica');
          doc.setFontType('bold');
          doc.setTextColor(0, 0, 0);
          doc.text(15,35,'CONFERENCIA INTERNACIONAL EN INTELIGENCIA ARTIFICIAL y');
          doc.setTextColor(192, 57, 43);
          doc.text(15.5,35,'CONFERENCIA INTERNACIONAL EN INTELIGENCIA ARTIFICIAL y');

          doc.setTextColor(0, 0, 0);
          doc.text(30,45,'DESARROLLO MODERNO DE SOFTWARE – CIIA 2018');
          doc.setTextColor(192, 57, 43);
          doc.text(30.5,45,'DESARROLLO MODERNO DE SOFTWARE – CIIA 2018');
          //segunda frase
          doc.setFont('helvetica');
          doc.setFontType('bold');
          doc.setTextColor(0, 0, 0);
          doc.setFontSize(25);
          doc.text(40,70,'CONSTANCIA DE MATRICULA');


          doc.setTextColor(36, 113, 163);
          doc.text(40.5,70,'CONSTANCIA DE MATRICULA');

          doc.setFontSize(20);
          doc.setTextColor(0, 0, 0);
          doc.setFont('times');
          doc.setFontType('italic');

          doc.text(15, 90, 'DNI: '+this.recibidos.dni);
          doc.text(15, 100, 'Nombre: '+this.recibidos.nombre);
          doc.text(15, 110, 'Apellidos: '+this.recibidos.apellidos);
          doc.text(15, 120, 'Correo: '+this.recibidos.correo);
          doc.save('reporte.pdf');

        },
        error: (err) => {
          console.error('Error en consulta!:', err);
          alert(err);
        },
        complete: () => {
          console.log('Consulta satisfactoria.');
        }
      });


  }

  AgregarUser() {
    const aux = new ExtracDataUtils();

    this.user = <UserModel> aux.extrac(document);
    this.user.talleres = this.talleres;

    this.guardarInscripcion(this.user);

  }

  public guardarInscripcion(inscripcion: UserModel) {
    this._registerService.guardarIns(inscripcion)
      .subscribe({
        next: (data) => {
          console.log('Datos Enviados:', data);
        },
        error: (err) => {
          console.error('Error!:', err);
        },
        complete: () => {
          // setTimeout(window.location.reload(), 3000);
        }
      });
  }

  public obtenerTalleres() {
    this._registerService.obtenerTalleres()
      .subscribe({
        next: (data) => {
          this.dates = data;
          console.log('Datos Enviados:', data);
        },
        error: (err) => {
          console.error('Error!:', err);
        },
        complete: () => {
          console.log('Guardar Datos OK.');
          let k = 0;
          for (const x of this.dates) {
            x['n'] = 'T' + k++;
          }
        }
      });
  }

  public variarCosto(value, data) {

    if (value == true) {

      this.total = this.total + 10;
      this.agregarTaller(data['_id']);
    }
    else {
      this.total = this.total - 10;
      this.quitarTallere(data['_id']);
    }
    console.log(this.talleres);
  }


  public agregarTaller(id) {

    this.talleres = this.talleres.filter(e => e != id);
    this.talleres.push(id);
  }

  public quitarTallere(id) {
    this.talleres = this.talleres.filter(e => e != id);
  }
}
